import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import MainLogo from '../assets/main-logo.svg'
import UxWork from '../components/UxWork'

function UxDesign() {

  let work = [
    {
      'title': 'example title',
      'subtitle': 'example subtitle',
      'date': '11/23',
      'img': ''
    }
  ]


  return (
    <div className="UxDesign">
      <Link to="/"><img className="logo"  src={MainLogo} alt='MainLogo' /></Link>
      <h1>User Experience Design</h1>
      {work.map((w) => {
        return <UxWork title={w.title} subtitle={w.subtitle} date={w.date} image={w.img} />
      })}
    </div>
  );
}

export default UxDesign;
